import React from 'react';
import './FaceRecognition.css';

const FaceRecognition = ({imageUrl, box}) => {
	const adding = [10,20,30,40];
	
	return (
		<div className='center ma'>
			<div className='absolute mt3'>
				<img id='inputimage' alt='myImage' src={imageUrl} width='600px' height='auto' />
				<div>
					{	
						[box].map((box, i) => {
							return (
							<div className='bounding-box' 
											style={{
													top: box.top + i * 10, 
													right:box.right + i * 10,
													bottom:box.bottom + i * 10,
													left: box.left + i * 10
												  }}>
							</div>
							);
						})
					}
						  
						
					
				</div>
			</div>
		</div>
	)
}

export default FaceRecognition;


